[{
  "key": "description",
  "value": "In multiple functions of io_uring.c, there is a possible kernel memorycorruption due to improper locking. This could lead to local escalation ofprivilege in the kernel with System execution privileges needed. Userinteraction is not needed for exploitation.     Update Instructions:     Run `sudo pro fix CVE-2023-21400` to fix the vulnerability. The problem can be corrected     by updating your system to the following package versions: linux-image-5.15.0-82-generic - 5.15.0-82.91~20.04.1 linux-image-5.15.0-82-generic-lpae - 5.15.0-82.91~20.04.1 linux-image-unsigned-5.15.0-82-generic - 5.15.0-82.91~20.04.1 linux-image-unsigned-5.15.0-82-generic-64k - 5.15.0-82.91~20.04.1 No subscription required linux-image-unsigned-5.15.0-1043-aws - 5.15.0-1043.48~20.04.1 No subscription required linux-image-unsigned-5.15.0-1045-azure - 5.15.0-1045.52~20.04.1 No subscription required linux-image-unsigned-5.15.0-1046-azure-fde - 5.15.0-1046.53~20.04.1.1 No subscription required linux-image-unsigned-5.15.0-1040-gcp - 5.15.0-1040.48~20.04.1 No subscription required linux-image-unsigned-5.15.0-1026-gkeop - 5.15.0-1026.31~20.04.1 No subscription required linux-image-unsigned-5.15.0-1038-intel-iotg - 5.15.0-1038.43~20.04.1 No subscription required linux-image-unsigned-5.15.0-82-lowlatency - 5.15.0-82.91~20.04.1 linux-image-unsigned-5.15.0-82-lowlatency-64k - 5.15.0-82.91~20.04.1 No subscription required linux-image-unsigned-5.15.0-1041-oracle - 5.15.0-1041.47~20.04.1 No subscription required linux-image-unsigned-5.15.0-1036-ibm - 5.15.0-1036.39~20.04.1 No subscription required"
}]

[{
  "key": "description",
  "value": "A side channel vulnerability on some of the AMD CPUs may allow an attackerto influence the return address prediction. This may result in speculativeexecution at an attacker-controlled address, potentially leading toinformation disclosure.     Update Instructions:     Run `sudo pro fix CVE-2023-20569` to fix the vulnerability. The problem can be corrected     by updating your system to the following package versions: amd64-microcode - 3.20191218.1ubuntu1.2 No subscription required linux-image-5.15.0-113-generic - 5.15.0-113.123~20.04.1 linux-image-5.15.0-113-generic-lpae - 5.15.0-113.123~20.04.1 linux-image-unsigned-5.15.0-113-generic - 5.15.0-113.123~20.04.1 linux-image-unsigned-5.15.0-113-generic-64k - 5.15.0-113.123~20.04.1 No subscription required linux-image-unsigned-5.15.0-1063-aws - 5.15.0-1063.69~20.04.1 No subscription required linux-image-unsigned-5.15.0-1065-azure - 5.15.0-1065.74~20.04.1 No subscription required linux-image-unsigned-5.15.0-1065-azure-fde - 5.15.0-1065.74~20.04.1.1 No subscription required linux-image-unsigned-5.15.0-1062-gcp - 5.15.0-1062.70~20.04.1 No subscription required linux-image-unsigned-5.15.0-1046-gkeop - 5.15.0-1046.53~20.04.1 No subscription required linux-image-unsigned-5.15.0-1058-intel-iotg - 5.15.0-1058.64~20.04.1 No subscription required linux-image-unsigned-5.15.0-110-lowlatency - 5.15.0-110.120~20.04.1 linux-image-unsigned-5.15.0-110-lowlatency-64k - 5.15.0-110.120~20.04.1 No subscription required linux-image-unsigned-5.15.0-1061-oracle - 5.15.0-1061.67~20.04.1 No subscription required linux-image-unsigned-5.15.0-1057-ibm - 5.15.0-1057.60~20.04.1 No subscription required"
