[{
  "key": "Recommendation",
  "value": "Ensure your applications are configured with an alternate form of authentication. Then, go to https://console.cloud.google.com/apis/credentials?project\u003dd5assistant. In the section \"API keys,\" click the trash can icon in front of every API key."
},{
  "key": "ExceptionInstructions",
  "value": "Add the security mark \"allow_api_key_exists\" to the asset with a value of \"true\" to prevent this finding from being activated again."
},{
  "key": "Explanation",
  "value": "API Keys are insecure because they are simple encrypted strings and are easier for others to discover and use. They can be retrieved on devices on which the key is stored or can be seen publicly, e.g., from within a browser. Additionally, API keys do not uniquely identify the user or application making the request. For these reasons, it is recommended to use standard authentication flow instead. See https://cloud.google.com/docs/authentication/api-keys for more information."
