[{
  "key": "Recommendation",
  "value": "CREATE METRIC: Go to https://console.cloud.google.com/logs/metrics?project\u003dd5assistant and click \"CREATE METRIC\". Under \"Metric Type\", select \"Counter\". Under \"Details\", set a \"Log metric name\", add a description, and set \"Units\" to \"1\". Under \"Filter selection\", add the recommended log filter below, replacing any existing text. Click \"Create Metric\". You should see a confirmation. Recommended log filter: (protoPayload.serviceName\u003d\"cloudresourcemanager.googleapis.com\") AND (ProjectOwnership OR projectOwnerInvitee) OR (protoPayload.serviceData.policyDelta.bindingDeltas.action\u003d\"REMOVE\" AND protoPayload.serviceData.policyDelta.bindingDeltas.role\u003d\"roles/owner\") OR (protoPayload.serviceData.policyDelta.bindingDeltas.action\u003d\"ADD\" AND protoPayload.serviceData.policyDelta.bindingDeltas.role\u003d\"roles/owner\") CREATE ALERT POLICY: Go to https://console.cloud.google.com/logs/metrics?project\u003dd5assistant. In the \"User-defined Metrics\" section, select the metric you created in the previous section. Click the 3 dot icon in the rightmost column, then select \"Create alert from metric\". If you are asked to add your project to a workspace, complete that process. On the page that opens, in the navigation menu, click \"Alerting\". Under \"What do you want to track?\", click \"Add Condition\" and complete the dialog to define what resources are monitored and when alerts are triggered. For information on the fields in a condition, see https://cloud.google.com/monitoring/alerts/ui-conditions-ga. When done, click \"Add\", then click \"Next\". Under \"Who should be notified?\", click the \"Notification Channels\" drop-down and select how you would like to be notified. For more information see https://cloud.google.com/monitoring/support/notification-options. Click \"OK\", then click \"Next\". Under \"What are the steps to fix the issue?\", set an \"Alert name\". Click \"Save\"."
},{
