  "key": "ExceptionInstructions",
  "value": "Add the security mark \"allow_sql_contained_database_authentication\" to the asset with a value of \"true\" to prevent this finding from being activated again."
},{
  "key": "Explanation",
  "value": "The \"contained database authentication\" flag allows you to have all database settings and metadata required to define the database and has no configuration dependencies on the instance of the Database Engine where the database is installed. Enabling this flag is not recommended because of the following: Users can connect to the database without authenticating a login at the Database Engine level. Isolating the database from the Database Engine makes it possible to easily move the database to another instance of SQL Server. Contained databases have some unique threats that should be understood and mitigated by SQL Server Database Engine administrators. Most of the threats are related to the USER WITH PASSWORD authentication process, which moves the authentication boundary from the Database Engine level to the database level."
