  "key": "Recommendation",
  "value": "Go to https://console.cloud.google.com/apis/credentials?project\u003dd5assistant. In the section \"API keys,\" for each API key, click on the name of the key. It will display API Key properties on a new page. In the \"Key restrictions\" section, set API restrictions to \"Restrict key.\" Click the \"Select APIs\" dropdown menu that appears below to choose which APIs to allow. Click \"Save.\" Note: Do not set API restrictions to allow \"Google Cloud APIs,\" as it allows access to all services offered by Google Cloud."
