  "key": "ExceptionInstructions",
  "value": "Add the security mark \"allow_api_key_apis_unrestricted\" to the asset with a value of \"true\" to prevent this finding from being activated again."
},{
  "key": "Explanation",
  "value": "Unrestricted API keys are insecure because they can be retrieved on devices on which the key is stored or can be seen publicly, e.g., from within a browser. In accordance with the principle of least privileges, it is recommended to restrict the APIs that can be called using each API key to only those required by an application. For more information, see https://cloud.google.com/docs/authentication/api-keys#api_key_restrictions"
